                        <Card.Title as="h5">{props.patientData.name}</Card.Title>
                        <Card.Text className="patientsRoom">{props.patientData.roomNumber}</Card.Text>
                   </Card.Body>
                </Card.Link>
            </Card>
            </CardDeck>

        </div>

    )
} //style={{width: '18rem'}}

